function createPDF() {
    if (document.getElementById("nombre").value == "") {
        alert("Faltan Datos");
    } else {
        var doc = new jsPDF('l');
        var imgData = 'data:image/jpeg;base64,';
        doc.addImage(imgData, 'JPEG', 0, 0, 297, 210)
        doc.setFont('Dosis-SemiBold', 'normal');
        doc.text(document.getElementById("nombre").value, 155, 88);

        doc.save("output.pdf");

    }
}